    "2016-07-16T01:35:01.104889",nt"name": "digital-aerial-image-compressed-project-mosaic-of-the-payette-valley-idaho",nt"isopen":
    false,nt"url": null,nt"notes": "An aerial photograph is a photograph of
    the earth's surface taken with a camera mounted in an airplane. The geographic extent
    of this scanned, georeferenced, and mosaiced 1.5-meter pixel resolution color infrared
    (CIR) digital aerial photograph is approximately the Payette Valley in Idaho. 28
    tiles acquired as part of the 1997 Payette Valley Air Photo Project are included
    in this mosaic. The collection area includes some of Gem county, central Payette
    county and parts of southern Washington county. The 1:24,000-scale color infrared
    aerial photography used in the production of this mosaiced image was flown by Valley
    Air Photos, Caldwell, Idaho.",nt"license_title": null,nt"extras": [{ntt"key":
